import { getRandomInt } from "./Random.js";

const FOOD_TYPES = {
  common: {
    type: "common",
    cost: 1,
  },
};

export const createFood = (boardSize) => {
  const cord = { x: getRandomInt(boardSize), y: getRandom(boardSize) };
  console.log(cord);
  return { ...cord, ...FOOD_TYPES.common };
};
